import React, { useEffect, useState } from "react";
import { Field, Form, Formik } from "formik";
import axios, { Axios } from "axios";
import { ToastContainer } from "react-toastify";
import { displayError, displaySuccess } from "../utils/toast";
import FormikInput from "./Formik/FormikInput";
import FormikRadio from "./Formik/FormikRadio";
import genders from "../data/gender";

const Register = () => {
  let [firstName, setFirstName] = useState("");
  let [lastName, setLastName] = useState("");
  let [email, setEmail] = useState("");
  let [password, setPassword] = useState("");
  let [dob, setDob] = useState("");
  let [address, setAddress] = useState("");
  let [gender, setGender] = useState("female");
  let [location, setLocation] = useState({});

  let success = (pos) => {
    console.log(pos);
    setLocation(pos);
  };
  let error = (e) => {
    console.log(e);
  };
  useEffect(() => {
    navigator.geolocation.getCurrentPosition(success, error);
  }, []);
  console.log(location);
  localStorage.setItem("latitude", location.coords?.latitude);
  localStorage.setItem("longitude", location.coords?.longitude);


  let initialValues = {
    firstName: "",
    lastName: "",
    gender: "male",
    dob: "",
    address: "",
    password: "",
    email: "",
  };

  let onSubmit = async (data) => {
    data.role = "user";
    try {
      let result = await axios({
        url: "http://localhost:8000/users",
        method: "post",
        data: data,
      });
      displaySuccess(result.data.message);
      console.log(result);
    } catch (error) {
      console.log(error.response.data.message);
      displayError(error.response.data.message);
    }
  };
  return (
    <>
      <ToastContainer></ToastContainer>
      <Formik
        initialValues={initialValues}
        onSubmit={onSubmit}
        enableReinitialize
      >
        {(formik) => {
          return (
            <Form>
              <FormikInput
                label="First Name"
                id="firstName"
                type="text"
                name="firstName"
                onChange={(e) => {
                  formik.setFieldValue("firstName", e.target.value);
                }}
              ></FormikInput>
              <br></br>
              <FormikInput
                label="Last Name"
                id="lastName"
                type="text"
                name="lastName"
                onChange={(e) => {
                  formik.setFieldValue("lastName", e.target.value);
                }}
              ></FormikInput>
              <br></br>
              <FormikInput
                label="Email"
                id="email"
                type="email"
                name="email"
                onChange={(e) => {
                  formik.setFieldValue("email", e.target.value);
                }}
              ></FormikInput>
              <br></br>
              <FormikInput
                label="Password"
                id="password"
                type="password"
                name="password"
                onChange={(e) => {
                  formik.setFieldValue("password", e.target.value);
                }}
              ></FormikInput>
              <br></br>
              <FormikInput
                label="Address"
                id="address"
                type="text"
                name="address"
                onChange={(e) => {
                  formik.setFieldValue("address", e.target.value);
                }}
              ></FormikInput>
              <br></br>
              <FormikInput
                label="Date of Birth"
                id="dob"
                type="date"
                name="dob"
                onChange={(e) => {
                  formik.setFieldValue("dob", e.target.value);
                }}
              ></FormikInput>
              <br></br>
              <FormikRadio
                options={genders}
                name="gender"
                onChange={(e) => {
                  formik.setFieldValue("gender", e.target.value);
                  console.log(e.target.value);
                }}
              ></FormikRadio>
              <button type="submit">Register</button>
            </Form>
          );
        }}
      </Formik>
    </>
  );
};

export default Register;
